import wx
import base64
from io import BytesIO
from PIL import Image
from wx.lib import scrolledpanel
data = {
    "name": "test 3",
    "institution": "uneg",
    "images": [
        ""
    ],
    "reports": [
        "Sección para generar un informe rápido de las imágenes incluyendo su categorización."
    ]
}

class WindowsViewer(wx.Frame):
    def __init__(self, parent, title, images_base64, report_text):
        super(WindowsViewer, self).__init__(parent, title=title, size=(800, 600))

        panel = wx.Panel(self)
        sizer = wx.BoxSizer(wx.VERTICAL)

        # Panel para el reporte
        report_box = wx.TextCtrl(panel, value=report_text, style=wx.TE_MULTILINE | wx.TE_READONLY, size=(700, 100))
        sizer.Add(report_box, 0, wx.ALL | wx.EXPAND, 10)

        # Panel para las imágenes con scrolling
        scroll_panel = scrolledpanel.ScrolledPanel(panel, -1, size=(700, 400), style=wx.SIMPLE_BORDER)
        scroll_sizer = wx.BoxSizer(wx.VERTICAL)

        # Recorrer todas las imágenes en base64
        for img_base64 in images_base64:
            image = self.decode_base64_image(img_base64)
            if image:
                wx_image = self.pil_image_to_wx(image)
                bitmap = wx.StaticBitmap(scroll_panel, -1, wx_image)
                scroll_sizer.Add(bitmap, 0, wx.ALL, 10)

        scroll_panel.SetSizer(scroll_sizer)
        scroll_panel.SetAutoLayout(1)
        scroll_panel.SetupScrolling()

        # Añadir el panel con las imágenes al sizer principal
        sizer.Add(scroll_panel, 1, wx.ALL | wx.EXPAND, 10)

        panel.SetSizer(sizer)
        self.Centre()
        self.Show()

    def decode_base64_image(self, img_base64):
        try:
            missing_padding = len(img_base64) % 4
            if missing_padding:
                img_base64 += '=' * (4 - missing_padding)

            image_data = base64.b64decode(img_base64)
            image = Image.open(BytesIO(image_data))
            return image
        except Exception as e:
            print(f"Error al decodificar la imagen base64: {e}")
            return None

    def pil_image_to_wx(self, pil_image):
        width, height = pil_image.size
        return wx.Bitmap.FromBuffer(width, height, pil_image.convert("RGB").tobytes())


